from django.db import modelsfrom apps.account.models import Accountclass BookingModel(models.Model):    series = models.CharField(max_length=50, blank=True, null=True)    created_by = models.ForeignKey(Account, related_name="booking", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_booking", on_delete=models.SET_NULL, null=True)    paid_amount = models.BigIntegerField(default=0)    def __str__(self):        return f"{self.series}"    @property    def absolute_sum(self):        # TODO: save services amount somewhere statically        return 1    @property    def debt_amount(self):        return self.absolute_sum - self.paid_amount